def TRANSFORMS(image_size=32):
    TRANSFORMS_dict = { # True for trainset, False for testset
        'MNIST': {
            True: transforms.Compose([
                transforms.RandomResizedCrop(image_size),
                transforms.ToTensor(),
                transforms.Normalize((0.1307,), (0.3081,))
            ]),
            False: transforms.Compose([
                transforms.Resize(image_size),
                transforms.ToTensor(),
                transforms.Normalize((0.1307,), (0.3081,))
            ])
        },
        'CIFAR-10': {
            True: transforms.Compose([
                transforms.RandomResizedCrop(image_size),
                transforms.RandomHorizontalFlip(),
                transforms.ToTensor(),
                transforms.Normalize((0.4914, 0.4822, 0.4465), (0.2023, 0.1994, 0.2010))
            ]),
            False: transforms.Compose([
                transforms.Resize(image_size),
                transforms.ToTensor(),
                transforms.Normalize((0.4914, 0.4822, 0.4465), (0.2023, 0.1994, 0.2010))
            ])
        },
        'CUB200': {
            True: transforms.Compose([
                transforms.RandomResizedCrop(image_size),
                transforms.RandomHorizontalFlip(),
                transforms.ToTensor(),
                transforms.Normalize((0.485, 0.456, 0.406), (0.229, 0.224, 0.225))
            ]),
            False: transforms.Compose([
                transforms.Resize(int(image_size * 8 / 7)), #224->256 / 32->36
                transforms.CenterCrop(image_size),
                transforms.ToTensor(),
                transforms.Normalize((0.485, 0.456, 0.406), (0.229, 0.224, 0.225))
            ])
        },
        'Stanford-Dogs': {
            True: transforms.Compose([
                transforms.RandomResizedCrop(image_size),
                transforms.RandomHorizontalFlip(),
                transforms.ToTensor(),
                transforms.Normalize((0.485, 0.456, 0.406), (0.229, 0.224, 0.225))
            ]),
            False: transforms.Compose([
                transforms.Resize(int(image_size * 8 / 7)), #224->256 / 32->36
                transforms.CenterCrop(image_size),
                transforms.ToTensor(),
                transforms.Normalize((0.485, 0.456, 0.406), (0.229, 0.224, 0.225))
            ])
        }
    }
    return TRANSFORMS_dict

class CUB200(Dataset):
    def __init__(self, root, train=True, transform=None):
        self.root = root
        self.transform = transform
        self.train = train
        self.base_folder = 'CUB_200_2011/images'

        images = pd.read_csv(os.path.join(self.root, 'CUB_200_2011', 'images.txt'), sep=' ', names=['img_id', 'filepath'])
        image_class_labels = pd.read_csv(os.path.join(self.root, 'CUB_200_2011', 'image_class_labels.txt'),
                                         sep=' ', names=['img_id', 'target'])
        CUB200_split_txt = 'train_test_split_100cls_50train_10test.txt' if isresampled else 'train_test_split.txt'
        train_test_split = pd.read_csv(os.path.join(self.root, 'CUB_200_2011', CUB200_split_txt),
                                       sep=' ', names=['img_id', 'is_training_img'])

        data = images.merge(image_class_labels, on='img_id')
        self.data = data.merge(train_test_split, on='img_id')

        if self.train:
            self.data = self.data[self.data.is_training_img == 1]
        else:
            self.data = self.data[self.data.is_training_img == 0]

    def __len__(self):
        return len(self.data)

    def __getitem__(self, idx):
        sample = self.data.iloc[idx]
        path = os.path.join(self.root, self.base_folder, sample.filepath)
        target = sample.target - 1  # Targets start at 1 by default, so shift to 0
        if isresampled:
            target = SAMPLED_CLS_INDEX_REVERSE['CUB200'][target]
        img = Image.open(path).convert('RGB')

        if self.transform:
            img = self.transform(img)

        return img, target

class STANFORD_DOGS(Dataset):
    def __init__(self, root, train=True, transform=None):
        self.root = root
        self.train = train
        self.transform = transform

        self.images_folder = os.path.join(self.root, 'Images')
        self.annotations_folder = os.path.join(self.root, 'Annotation')
        self._breeds = os.listdir(self.images_folder)

        split = self.load_split()
        self._breed_images = [(annotation + '.jpg', idx) for annotation, idx in split]

    def __len__(self):
        return len(self._breed_images)

    def __getitem__(self, index):
        image_name, target_class = self._breed_images[index]
        image_path = os.path.join(self.images_folder, image_name)
        image = Image.open(image_path).convert('RGB')
        if self.transform:
            image = self.transform(image)
        if isresampled:
            target_class = SAMPLED_CLS_INDEX_REVERSE['Stanford-Dogs'][target_class]
        return image, target_class

    def load_split(self):
        if self.train:
            split = loadmat(os.path.join(self.root, 'train_list.mat'))['annotation_list']
            labels = loadmat(os.path.join(self.root, 'train_list.mat'))['labels']
        else:
            split = loadmat(os.path.join(self.root, 'test_list.mat'))['annotation_list']
            labels = loadmat(os.path.join(self.root, 'test_list.mat'))['labels']

        split = [item[0][0] for item in split]
        labels = [item[0] - 1 for item in labels]
        return list(zip(split, labels))

DATASETS = {
    'MNIST': datasets.MNIST,
    'CIFAR-10': datasets.CIFAR10,
    'CUB200': CUB200,
    'Stanford-Dogs': STANFORD_DOGS
}

def loadDataSetRaw(name, istrain=False, resampled=True):
    root = DATASET_ROOTS[name]
    dataset = DATASETS[name](root=root, train=istrain, transform=None)
    if resampled:
        dataset = torch.utils.data.Subset(dataset, indices=SAMPLED_INDEX[name][istrain])
    return dataset

